import Wrapper from '../components/UI/WrapperNoColor';
import classes from '../components/Partners/PartnersList.module.css';

const PrivacyPolicy = () => {
  return (
    <Wrapper>
      <div className={classes.title}>
        <h2>BUSINESS PARTNERS</h2>
        <div className={classes["title-underline"]} />
      </div>
    </Wrapper>
  )
};

export default PrivacyPolicy;
